import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div style={{height:'2px',backgroundColor:'#82cff2', marginTop:'20px'}}></div>
        <div style={{minHeight:'800px'}}>
          <h1>林芷庭</h1>
          <p>
            1993 年出生<br/>
            信箱: hw810108@gmail.com<br/>
            電話: 0988-550-901<br/>
            GitHub https://github.com/ChihTingLin<br/>
          </p>
        </div>
        <div style={{height:'2px',backgroundColor:'#82cff2', marginBottom:'20px'}}></div>
      </div>
    );
  }
}

export default App;
